import React from 'react';
import './SessionNameInput.css';

function SaveSessionsPanel() {
    return (
        <section id="SessionNameInput" className={this.props.visible ? 'visible' : null}>
            <section id="SessionNameInputButtons">
                <button className="button" onClick={this.props.hideSaveSessionInput}>Back</button>
            </section>
            <form onSubmit={this.props.saveSession}>
                <label>
                    Name:
                    <input type="text" onChange={this.props.updateSessionName} value={this.props.sessionName} autoCorrect="false" spellCheck="false" />
                </label>
                <label>
                    Notes:
                    <textarea onChange={this.props.updateSessionNotes} value={this.props.sessionNotes} autoCorrect="false" spellCheck="false"></textarea>
                </label>
                <input type="submit" onClick={this.props.saveSession} />
            </form>
        </section>
    );
}

export default SaveSessionsPanel;
